import React from 'react';

function Profile() {
  return (
    <div className="profile-container">
      <div className="profile-left">
        <figure className="image">
          <img
            style={{ width: '906px' }}
            src={`${process.env.PUBLIC_URL}/profilephoto.jpg`}
            alt="Profile"
          />
        </figure>
      </div>
      <div className="profile-right">
        <h2>Bohyeon Park | 박보현</h2>
        <p>I’m interested in Solutions Architecting and Cloud Engineering : )</p>
        <p>
          <mark className="highlight-orange_background">
            <code>Cloud Engineering</code>
          </mark>{' '}
          <mark className="highlight-red_background">
            <code>Solutions Architect</code>
          </mark>{' '}
          <mark className="highlight-blue_background">
            <code>AWS</code>
          </mark>{' '}
          <code>GCP</code>
        </p>
      </div>
      <div className="technical-research">
        <TechnicalResearch />
      </div>
    </div>
  );
}

export default Profile;
